import React from "react";
import Common from "./Common";
import reactlogo from "./img/react-logo.png";
const Home = () => {
  return (
    <>
      <Common
        name="Website in"
        imgsrc={reactlogo}
        visit="/service"
        btnname="Contact Now"
      />
    </>
  );
};

export default Home;
